-- ----------------------------
-- Table structure for creature_template
-- ----------------------------
DROP TABLE IF EXISTS `creature_template`;
CREATE TABLE `creature_template`  (
  `Entry` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This is the Primary NPC Entry Number and is Also the Dungeon Normal Mode / Raid ',
  `Name` char(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'The creature\'s name that will be displayed.',
  `SubName` char(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'An optional tag, which will be shown below the creature\'s name.',
  `MinLevel` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT 'The minimum level of the creature when it is spawned in-game.',
  `MaxLevel` tinyint UNSIGNED NOT NULL DEFAULT 1 COMMENT 'The maximum level of the creature when it is spawned in-game.',
  `ModelId1` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'A display model identifier for the creature_template.',
  `ModelId2` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'An alternative display model identifier for the creature_template.',
  `ModelId3` mediumint UNSIGNED NOT NULL DEFAULT 0,
  `ModelId4` mediumint UNSIGNED NOT NULL DEFAULT 0,
  `FactionAlliance` smallint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The Faction If The Creature Is On The Alliance Side (See FactionTemplate.dbc).',
  `FactionHorde` smallint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The Faction If The Creature Is On The Alliance Side (See FactionTemplate.dbc).',
  `Scale` float NOT NULL DEFAULT 1 COMMENT 'The scale/size of the creature.<br />\nNormal => 1 (100%)',
  `Family` tinyint NOT NULL DEFAULT 0 COMMENT 'This Defines The Family That This Creature Belongs To.',
  `CreatureType` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This Field Defines The Type Of Creature This NPC Is.',
  `InhabitType` tinyint UNSIGNED NOT NULL DEFAULT 3 COMMENT 'This Field Controls Where The Creature Can Move Into, Chase And Attack.',
  `RegenerateStats` tinyint UNSIGNED NULL DEFAULT NULL COMMENT 'Controls if a creature template should regenerate it\'s Health/Mana.',
  `RacialLeader` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if a creature template is a racial leader.',
  `NpcFlags` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The flags of the creature.\n',
  `UnitFlags` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Allows the manual application of unit flags to creatures.',
  `DynamicFlags` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Dynamic flags are used to control the visual appearance of a creature template.',
  `ExtraFlags` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The extra flags allow to modify special behaviour for a creature_template. ',
  `CreatureTypeFlags` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Type flags seem to control what actions a player can perform.',
  `SpeedWalk` float NOT NULL DEFAULT 1 COMMENT 'Controls how fast the creature can move in walking mode.',
  `SpeedRun` float NOT NULL DEFAULT 1.14286 COMMENT 'Controls how fast the creature can move in running mode.',
  `UnitClass` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'A creature\'s class. The following table describes the available classes.',
  `Rank` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The border of a creature portrait.',
  `HealthMultiplier` float NOT NULL DEFAULT 1 COMMENT 'Modifies the creature template\'s health by this factor.',
  `PowerMultiplier` float NOT NULL DEFAULT 1 COMMENT 'The affects the creature\'s power.',
  `DamageMultiplier` float NOT NULL DEFAULT 1 COMMENT 'This affects the amount of damage a creature can do.',
  `DamageVariance` float NOT NULL DEFAULT 1 COMMENT 'This is used in damage calculations.',
  `ArmorMultiplier` float NOT NULL DEFAULT 1 COMMENT 'Modify the creature template\'s armor by this factor.',
  `ExperienceMultiplier` float NOT NULL DEFAULT 1 COMMENT 'This affects the amount of experience the creature will earn.',
  `MinLevelHealth` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The minimum health of the creature.',
  `MaxLevelHealth` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The maximum health of the creature.',
  `MinLevelMana` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The miminum mana of the creature if the creature has variable mana.',
  `MaxLevelMana` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The maximum mana of the creature.',
  `MinMeleeDmg` float NOT NULL DEFAULT 0 COMMENT 'Minimum damage the creature deals in melee combat.',
  `MaxMeleeDmg` float NOT NULL DEFAULT 0 COMMENT 'Maximum damage the creature deals in melee combat.',
  `MinRangedDmg` float NOT NULL DEFAULT 0 COMMENT 'Minimum damage the creature deals in ranged combat.',
  `MaxRangedDmg` float NOT NULL DEFAULT 0 COMMENT 'Maximum damage the creature deals in ranged combat.',
  `Armor` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The total armor of the creature.',
  `MeleeAttackPower` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The attack power for the creature\'s melee attacks.',
  `RangedAttackPower` smallint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The attack power for the creature\'s ranged attacks.',
  `MeleeBaseAttackTime` int UNSIGNED NOT NULL DEFAULT 2000 COMMENT 'A creature\'s melee attack time in milliseconds.',
  `RangedBaseAttackTime` int UNSIGNED NOT NULL DEFAULT 2000 COMMENT 'The delay between ranged attacks, in milliseconds.',
  `DamageSchool` tinyint NOT NULL DEFAULT 0 COMMENT 'A damage school for melee combat.',
  `MinLootGold` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Minimum money the creature drops when killed, in copper.',
  `MaxLootGold` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The money dropped by the creature in copper.',
  `LootId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This adds loot to the creature.',
  `PickpocketLootId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This adds pickpocket loot to the creature.',
  `SkinningLootId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This adds skinning loot to the creature.',
  `KillCredit1` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'If killing a creature should credit towards a different creature_template.',
  `KillCredit2` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'If killing a creature should credit towards a different creature_template.',
  `MechanicImmuneMask` int UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This mask can be used to make creatures immune to spell mechanics.',
  `SchoolImmuneMask` int UNSIGNED NOT NULL DEFAULT 0,
  `ResistanceHoly` smallint NOT NULL DEFAULT 0 COMMENT 'The Holy resistance of the creature.',
  `ResistanceFire` smallint NOT NULL DEFAULT 0 COMMENT 'The Fire resistance of the creature.',
  `ResistanceNature` smallint NOT NULL DEFAULT 0 COMMENT 'The Nature resistance of the creature.',
  `ResistanceFrost` smallint NOT NULL DEFAULT 0 COMMENT 'The Frost resistance of the creature.',
  `ResistanceShadow` smallint NOT NULL DEFAULT 0 COMMENT 'The Shadow resistance of the creature.',
  `ResistanceArcane` smallint NOT NULL DEFAULT 0 COMMENT 'The Arcane resistance of the creature.',
  `SpellListId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'ID of combat spells list that creature will use by default.',
  `PetSpellDataId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'ID that displays what spells the pet has in the client.',
  `MovementType` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The movement type defines what a creature spawn will behave like after spawning.',
  `TrainerType` tinyint NOT NULL DEFAULT 0 COMMENT 'This details what kind of trainer the creature is.',
  `TrainerSpell` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This will restrict access to a profession trainer.',
  `TrainerClass` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The value of this field will restrict access to class and/or pet trainers',
  `TrainerRace` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This field allows to restrict a riding trainer to a specific race.',
  `TrainerTemplateId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This field adds a training spells to a creature template.',
  `VendorTemplateId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This field adds a vendor items to a creature template.',
  `GossipMenuId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'This field is used for adding gossip to the creature.',
  `EquipmentTemplateId` mediumint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The field adds equipment to a creature.',
  `Civilian` tinyint UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Marks a creature template as a civilian.',
  `AIName` char(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'This string determines which built-in AI script will be used.',
  PRIMARY KEY (`Entry`) USING BTREE
) ENGINE = MyISAM CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Creature System' ROW_FORMAT = DYNAMIC;

